import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'; 
import App from './App.module';
import Header from './Header.module'; 
import Footer from './Footer.module';
import HeroSection from './Herosection.module'; 
import Newsroom from './Newsroom.module'; 
import Portfolio from './Portfolio.module'; 
import Vision from './Vision.module'; 
import People from './people.module'; 
import Society from './society.module'; 
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <div>
        <Header />
        <App />
        <Footer />
        <HeroSection />
        <Newsroom />
        <Portfolio />
        <Vision />
        <People />
        <Society />
      </div>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
